  function manageCoin() {
    computedTop = parseInt(document.getElementById("narwhal").style.top.toString().replace("px", "")) || 0;
    collected = false;

    // shift
    if (!coinVisible) {
      coinVisible = true;
      coinLeft = 800;
      coinLane = Math.floor(Math.random() * 2);
    } else {
      coinLeft -= animationStep;
      if (coinLeft < 0) {
        coinVisible = false;
      }
      if (coinLeft < 400 && coinLane == 0 && computedTop < 100) {
        coinVisible = false;
        collected = true;
      }
      if (coinLeft < 400 && coinLane == 1 && computedTop > 134) {
        coinVisible = false;
        collected = true;
      }
    }
    if (collected) {
      audio.play();
      points++;
      document.getElementById("points").innerText = points;
    }

    // display
    coin = document.getElementById("diamond");
    if (coinVisible) {
      coin.style.display = "block";
      coin.style.left = coinLeft.toString() + "px";
      coin.style.top = (10 + coinLane * 250).toString() + "px";
    } else {
      coin.style.display = "none";
    }
  }

  function move() {
    bottom1 = document.getElementById("bottom1")
    bottom2 = document.getElementById("bottom2")
    bottom1.style["objectPosition"] = offset.toString() + "px 0px"
    bottom2.style["objectPosition"] = (838 + offset).toString() + "px 0px"
    offset = ((offset - animationStep) % 838);
    manageCoin();
  }

  function safeDistance() {
    numSteps = speed / speedStep;
    safeDist = speedStep * (numSteps * (numSteps + 1) / 2)
    computedTop = parseInt(document.getElementById("narwhal").style.top.toString().replace("px", "")) || 0
    if (key == "ArrowUp" && computedTop < safeDist) {
      return false;
    }
    if (key == "ArrowDown" && (theBottom - computedTop) < safeDist) {
      return false;
    }
    return true;
  }

  function shift() {
    if (pressed) {
      if (safeDistance()) {
        if (speed < maxSpeed) {
          speed += speedStep;
        }
      } else {
        speed = Math.max(0, speed - speedStep);
      }
    } else {
      newSpeed = Math.max(0, speed - speedStep);
      if (newSpeed <= 0) {
        clearInterval(interval);
        interval = null;
        key = null;
        return;
      } else {
        speed = newSpeed;
      }
    }

    if (key == "ArrowUp") {
      narwhaldepth -= speed;
    } else if (key === "ArrowDown") {
      narwhaldepth += speed;
    }
    narwhaldepth = Math.min(narwhaldepth, 200);
    narwhaldepth = Math.max(narwhaldepth, 0);
    document.getElementById("narwhal").style.top = narwhaldepth.toString() + "px"
  }

  function keyDown(evkey) {
    pressed = true;
    if (interval != null) {
      if (evkey == key) {
        return;
      } else {
        speed = 0;
      }
    } else {
      interval = setInterval(shift, 40);
    }
    key = evkey;
  }

  document.addEventListener("keydown", (event) => {
    keyDown(event.key);
  });

  document.addEventListener("touchstart", (event) => {
    if (event.targetTouches[0].pageY < 175) {
      keyDown("ArrowUp");
    } else {
      keyDown("ArrowDown");
    }
    event.preventDefault();
  });

  document.addEventListener("touchend", (event) => {
    pressed = false;
    event.preventDefault();
  });

  document.addEventListener("keyup", (event) => {
    pressed = false;
  });

  setInterval(function() {
    move()
  }, 40);
  </script>
